webpackJsonp([0x9fe5a81d0715],{558:function(e,t){e.exports={data:{markdownRemark:{html:'<p>Writing the opening post for this <em>"a year of apps"</em> series I had what I would have previously treated as an unrecoverable setback. I lost the post.</p>\n<p>After spending 20 minutes crafting the perfect post in the Tumblr iOS app, I decided to put it down, think it over, and make a cup of tea before posting. In the interim I used a few other apps, and when I returned the app had reset and the post was gone.</p>\n<p>Forcing myself to writing the post again (all be it a lot shorter) and not giving up with the challenge can only be a good sign of things to come.</p>',timeToRead:1,excerpt:'Writing the opening post for this  "a year of apps"  series I had what I would have previously treated as an unrecoverable setback. I lost…',frontmatter:{title:"Overcoming Setbacks",cover:"https://unsplash.it/1152/300/?random?Setbacks",date:"2016-01-26T22:26",tags:["A Year of Apps"],author:"eddie"},fields:{slug:"/overcoming-setbacks"}},prev:{excerpt:"",frontmatter:{title:"James Cameron's advice on becoming a film director applies to new game developers.",cover:"https://unsplash.it/1152/300/?random?Film",date:"2016-01-26T22:35"},fields:{slug:"/james-camerons-advice-on-becoming-a-film-director"}},next:{excerpt:"I’ve set myself a challenge for 2016; I will complete 12 projects. In previous years I’ve started countless apps…",frontmatter:{title:"A Year of Apps",cover:"https://unsplash.it/1152/300/?random?Apps",date:"2016-01-26T22:20"},fields:{slug:"/a-year-of-apps"}},authors:{edges:[{node:{id:"eddie",name:"Eddie Lee",image:"/images/eddielee.jpg",url:"https://twitter.com/eddielee6",bio:"Father and Software Engineer"}}]}},pathContext:{slug:"/overcoming-setbacks",total:42,prev:"/james-camerons-advice-on-becoming-a-film-director",next:"/a-year-of-apps"}}}});
